import styled from "styled-components";

//background: url(${backgroundImg}) no-repeat center;
export const Container = styled.div`
  display:grid;
  grid-template-columns: repeat(3, 1fr);
  gap: 2rem;
  margin-top: -10rem;

  div{
    background:var(--shape);
  }
`;
